var image = ""

func SendMsgToChan(sn string) {
	var msg util.MsgStruct
	var str []string
	random := rand.Intn(6)
	for {
		if random == 0 {
			random = rand.Intn(6)
		} else {
			break
		}
	}
	for i := 0; i < random; i++ {
		str = append(str, "A"+strconv.Itoa(i))
	}
	msg.Urls = str
	msg.Sn = sn
	//fmt.Println("ch length: ", len(util.GetChan()))
	util.SendToChan(msg)
}

