func SendToLark() error {
	larkChan := util.GetLarkChan()
	tk := time.Tick(time.Millisecond * util.PerMillisecond)
	for {
		select {
		case times := <-tk:
			fmt.Println(" -------------------------------秒: ", times.Minute(), "m-", times.Second(), "s")
			i := 0
			for data := range larkChan {
				i++
				go func(dd util.LarkMsgStruct, ii int, t string) {
					fmt.Println("--------send: ", ii)
					err := PictureBasicRecognize(dd, t)
					if err != nil {
						return
					}
				}(data, i, fmt.Sprintf("%vm-%vs", times.Minute(), times.Second()))
				if i == util.MaxLimit {
					break
				}
			}
		}
	}
}
